from enum import Enum


class Direction(Enum):
    LEFT = 1
    RIGHT = 2
    UP = 3
    DOWN = 4
    NONE = 5

def changeDirection(pos, direction, maze):
    (x, y)  = pos
    if direction != Direction.DOWN and y > 0:
        if maze[y-1][x] != ".":
            return Direction.UP
    if direction != Direction.UP and y < len(maze) - 1:
        if maze[y+1][x] != ".":
            return Direction.DOWN
    if direction != Direction.RIGHT and x > 0:
        if maze[y][x-1] != ".":
            return Direction.LEFT
    if direction != Direction.LEFT and x < len(maze[0]) - 1:
        if maze[y][x+1] != ".":
            return Direction.RIGHT
    return Direction.NONE

def solve(maze, start):
    letters = ""
    (x, y) = start
    currentDirection = Direction.DOWN
    steps = 1
    while currentDirection != Direction.NONE:
        currentMarker = maze[y][x] 
        print(letters)
        if currentMarker == ".":
            break
        if currentMarker == "+":
            currentDirection = changeDirection((x,y), currentDirection, maze)
        if currentMarker.isalpha():
            print(currentMarker)
            letters += currentMarker
        if currentDirection == Direction.DOWN:
            y += 1
        if currentDirection == Direction.UP:
            y -= 1
        if currentDirection == Direction.LEFT:
            x -= 1
        if currentDirection == Direction.RIGHT:
            x += 1
        steps += 1
    print(steps - 1) # we actually go one step too far.
    print(letters)



